import React from 'react'

const Footer = ()=>{
    return(
        <>
        <footer>
            <div className="container ">
                <div className="col-md-6">&copy; CopyRight</div>
                <div className="col-md-6">
                    <i className='fa fa-facebook-square'></i>
                </div>
            </div>
        </footer>
        </>
    )
}
export default Footer;
